$templateCache.put("src/client/bower_components/jquery-flot/examples/ajax/index.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=Content-Type content=\"text/html; charset=utf-8\"><title>Flot Examples: AJAX</title><link href=../examples.css rel=stylesheet type=text/css><script language=javascript type=text/javascript src=../../jquery.js></script><script language=javascript type=text/javascript src=../../jquery.flot.js></script><script type=text/javascript>\r\n\r\n	$(function() {\r\n\r\n		var options = {\r\n			lines: {\r\n				show: true\r\n			},\r\n			points: {\r\n				show: true\r\n			},\r\n			xaxis: {\r\n				tickDecimals: 0,\r\n				tickSize: 1\r\n			}\r\n		};\r\n\r\n		var data = [];\r\n\r\n		$.plot(\"#placeholder\", data, options);\r\n\r\n		// Fetch one series, adding to what we already have\r\n\r\n		var alreadyFetched = {};\r\n\r\n		$(\"button.fetchSeries\").click(function () {\r\n\r\n			var button = $(this);\r\n\r\n			// Find the URL in the link right next to us, then fetch the data\r\n\r\n			var dataurl = button.siblings(\"a\").attr(\"href\");\r\n\r\n			function onDataReceived(series) {\r\n\r\n				// Extract the first coordinate pair; jQuery has parsed it, so\r\n				// the data is now just an ordinary JavaScript object\r\n\r\n				var firstcoordinate = \"(\" + series.data[0][0] + \", \" + series.data[0][1] + \")\";\r\n				button.siblings(\"span\").text(\"Fetched \" + series.label + \", first point: \" + firstcoordinate);\r\n\r\n				// Push the new data onto our existing data array\r\n\r\n				if (!alreadyFetched[series.label]) {\r\n					alreadyFetched[series.label] = true;\r\n					data.push(series);\r\n				}\r\n\r\n				$.plot(\"#placeholder\", data, options);\r\n			}\r\n\r\n			$.ajax({\r\n				url: dataurl,\r\n				type: \"GET\",\r\n				dataType: \"json\",\r\n				success: onDataReceived\r\n			});\r\n		});\r\n\r\n		// Initiate a recurring data update\r\n\r\n		$(\"button.dataUpdate\").click(function () {\r\n\r\n			data = [];\r\n			alreadyFetched = {};\r\n\r\n			$.plot(\"#placeholder\", data, options);\r\n\r\n			var iteration = 0;\r\n\r\n			function fetchData() {\r\n\r\n				++iteration;\r\n\r\n				function onDataReceived(series) {\r\n\r\n					// Load all the data in one pass; if we only got partial\r\n					// data we could merge it with what we already have.\r\n\r\n					data = [ series ];\r\n					$.plot(\"#placeholder\", data, options);\r\n				}\r\n\r\n				// Normally we call the same URL - a script connected to a\r\n				// database - but in this case we only have static example\r\n				// files, so we need to modify the URL.\r\n\r\n				$.ajax({\r\n					url: \"data-eu-gdp-growth-\" + iteration + \".json\",\r\n					type: \"GET\",\r\n					dataType: \"json\",\r\n					success: onDataReceived\r\n				});\r\n\r\n				if (iteration < 5) {\r\n					setTimeout(fetchData, 1000);\r\n				} else {\r\n					data = [];\r\n					alreadyFetched = {};\r\n				}\r\n			}\r\n\r\n			setTimeout(fetchData, 1000);\r\n		});\r\n\r\n		// Load the first series by default, so we don\'t have an empty plot\r\n\r\n		$(\"button.fetchSeries:first\").click();\r\n\r\n		// Add the Flot version string to the footer\r\n\r\n		$(\"#footer\").prepend(\"Flot \" + $.plot.version + \" &ndash; \");\r\n	});\r\n\r\n	</script></head><body><div id=header><h2>AJAX</h2></div><div id=content><div class=demo-container><div id=placeholder class=demo-placeholder></div></div><p>Example of loading data dynamically with AJAX. Percentage change in GDP (source: <a href=\"http://epp.eurostat.ec.europa.eu/tgm/table.do?tab=table&init=1&plugin=1&language=en&pcode=tsieb020\">Eurostat</a>). Click the buttons below:</p><p>The data is fetched over HTTP, in this case directly from text files. Usually the URL would point to some web server handler (e.g. a PHP page or Java/.NET/Python/Ruby on Rails handler) that extracts it from a database and serializes it to JSON.</p><p><button class=fetchSeries>First dataset</button> [ <a href=data-eu-gdp-growth.json>see data</a> ] <span></span></p><p><button class=fetchSeries>Second dataset</button> [ <a href=data-japan-gdp-growth.json>see data</a> ] <span></span></p><p><button class=fetchSeries>Third dataset</button> [ <a href=data-usa-gdp-growth.json>see data</a> ] <span></span></p><p>If you combine AJAX with setTimeout, you can poll the server for new data.</p><p><button class=dataUpdate>Poll for data</button></p></div><div id=footer>Copyright &copy; 2007 - 2014 IOLA and Ole Laursen</div></body></html>");
$templateCache.put("src/client/bower_components/jquery-flot/examples/axes-interacting/index.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=Content-Type content=\"text/html; charset=utf-8\"><title>Flot Examples: Interacting with axes</title><link href=../examples.css rel=stylesheet type=text/css><script language=javascript type=text/javascript src=../../jquery.js></script><script language=javascript type=text/javascript src=../../jquery.flot.js></script><script type=text/javascript>\r\n\r\n	$(function() {\r\n\r\n		function generate(start, end, fn) {\r\n			var res = [];\r\n			for (var i = 0; i <= 100; ++i) {\r\n				var x = start + i / 100 * (end - start);\r\n				res.push([x, fn(x)]);\r\n			}\r\n			return res;\r\n		}\r\n\r\n		var data = [\r\n			{ data: generate(0, 10, function (x) { return Math.sqrt(x);}), xaxis: 1, yaxis:1 },\r\n			{ data: generate(0, 10, function (x) { return Math.sin(x);}), xaxis: 1, yaxis:2 },\r\n			{ data: generate(0, 10, function (x) { return Math.cos(x);}), xaxis: 1, yaxis:3 },\r\n			{ data: generate(2, 10, function (x) { return Math.tan(x);}), xaxis: 2, yaxis: 4 }\r\n		];\r\n\r\n		var plot = $.plot(\"#placeholder\", data, {\r\n			xaxes: [\r\n				{ position: \'bottom\' },\r\n				{ position: \'top\'}\r\n			],\r\n			yaxes: [\r\n				{ position: \'left\' },\r\n				{ position: \'left\' },\r\n				{ position: \'right\' },\r\n				{ position: \'left\' }\r\n			]\r\n		});\r\n\r\n		// Create a div for each axis\r\n\r\n		$.each(plot.getAxes(), function (i, axis) {\r\n			if (!axis.show)\r\n				return;\r\n\r\n			var box = axis.box;\r\n\r\n			$(\"<div class=\'axisTarget\' style=\'position:absolute; left:\" + box.left + \"px; top:\" + box.top + \"px; width:\" + box.width +  \"px; height:\" + box.height + \"px\'></div>\")\r\n				.data(\"axis.direction\", axis.direction)\r\n				.data(\"axis.n\", axis.n)\r\n				.css({ backgroundColor: \"#f00\", opacity: 0, cursor: \"pointer\" })\r\n				.appendTo(plot.getPlaceholder())\r\n				.hover(\r\n					function () { $(this).css({ opacity: 0.10 }) },\r\n					function () { $(this).css({ opacity: 0 }) }\r\n				)\r\n				.click(function () {\r\n					$(\"#click\").text(\"You clicked the \" + axis.direction + axis.n + \"axis!\")\r\n				});\r\n		});\r\n\r\n		// Add the Flot version string to the footer\r\n\r\n		$(\"#footer\").prepend(\"Flot \" + $.plot.version + \" &ndash; \");\r\n	});\r\n\r\n	</script></head><body><div id=header><h2>Interacting with axes</h2></div><div id=content><div class=demo-container><div id=placeholder class=demo-placeholder></div></div><p>With multiple axes, you sometimes need to interact with them. A simple way to do this is to draw the plot, deduce the axis placements and insert a couple of divs on top to catch events.</p><p>Try clicking an axis.</p><p id=click></p></div><div id=footer>Copyright &copy; 2007 - 2014 IOLA and Ole Laursen</div></body></html>");
$templateCache.put("src/client/bower_components/jquery-flot/examples/annotating/index.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=Content-Type content=\"text/html; charset=utf-8\"><title>Flot Examples: Adding Annotations</title><link href=../examples.css rel=stylesheet type=text/css><script language=javascript type=text/javascript src=../../jquery.js></script><script language=javascript type=text/javascript src=../../jquery.flot.js></script><script type=text/javascript>\r\n\r\n	$(function() {\r\n\r\n		var d1 = [];\r\n		for (var i = 0; i < 20; ++i) {\r\n			d1.push([i, Math.sin(i)]);\r\n		}\r\n\r\n		var data = [{ data: d1, label: \"Pressure\", color: \"#333\" }];\r\n\r\n		var markings = [\r\n			{ color: \"#f6f6f6\", yaxis: { from: 1 } },\r\n			{ color: \"#f6f6f6\", yaxis: { to: -1 } },\r\n			{ color: \"#000\", lineWidth: 1, xaxis: { from: 2, to: 2 } },\r\n			{ color: \"#000\", lineWidth: 1, xaxis: { from: 8, to: 8 } }\r\n		];\r\n\r\n		var placeholder = $(\"#placeholder\");\r\n\r\n		var plot = $.plot(placeholder, data, {\r\n			bars: { show: true, barWidth: 0.5, fill: 0.9 },\r\n			xaxis: { ticks: [], autoscaleMargin: 0.02 },\r\n			yaxis: { min: -2, max: 2 },\r\n			grid: { markings: markings }\r\n		});\r\n\r\n		var o = plot.pointOffset({ x: 2, y: -1.2});\r\n\r\n		// Append it to the placeholder that Flot already uses for positioning\r\n\r\n		placeholder.append(\"<div style=\'position:absolute;left:\" + (o.left + 4) + \"px;top:\" + o.top + \"px;color:#666;font-size:smaller\'>Warming up</div>\");\r\n\r\n		o = plot.pointOffset({ x: 8, y: -1.2});\r\n		placeholder.append(\"<div style=\'position:absolute;left:\" + (o.left + 4) + \"px;top:\" + o.top + \"px;color:#666;font-size:smaller\'>Actual measurements</div>\");\r\n\r\n		// Draw a little arrow on top of the last label to demonstrate canvas\r\n		// drawing\r\n\r\n		var ctx = plot.getCanvas().getContext(\"2d\");\r\n		ctx.beginPath();\r\n		o.left += 4;\r\n		ctx.moveTo(o.left, o.top);\r\n		ctx.lineTo(o.left, o.top - 10);\r\n		ctx.lineTo(o.left + 10, o.top - 5);\r\n		ctx.lineTo(o.left, o.top);\r\n		ctx.fillStyle = \"#000\";\r\n		ctx.fill();\r\n\r\n		// Add the Flot version string to the footer\r\n\r\n		$(\"#footer\").prepend(\"Flot \" + $.plot.version + \" &ndash; \");\r\n	});\r\n\r\n	</script></head><body><div id=header><h2>Adding Annotations</h2></div><div id=content><div class=demo-container><div id=placeholder class=demo-placeholder></div></div><p>Flot has support for simple background decorations such as lines and rectangles. They can be useful for marking up certain areas. You can easily add any HTML you need with standard DOM manipulation, e.g. for labels. For drawing custom shapes there is also direct access to the canvas.</p></div><div id=footer>Copyright &copy; 2007 - 2014 IOLA and Ole Laursen</div></body></html>");
