$templateCache.put("src/client/bower_components/jquery-flot/examples/realtime/index.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=Content-Type content=\"text/html; charset=utf-8\"><title>Flot Examples: Real-time updates</title><link href=../examples.css rel=stylesheet type=text/css><script language=javascript type=text/javascript src=../../jquery.js></script><script language=javascript type=text/javascript src=../../jquery.flot.js></script><script type=text/javascript>\r\n\r\n	$(function() {\r\n\r\n		// We use an inline data source in the example, usually data would\r\n		// be fetched from a server\r\n\r\n		var data = [],\r\n			totalPoints = 300;\r\n\r\n		function getRandomData() {\r\n\r\n			if (data.length > 0)\r\n				data = data.slice(1);\r\n\r\n			// Do a random walk\r\n\r\n			while (data.length < totalPoints) {\r\n\r\n				var prev = data.length > 0 ? data[data.length - 1] : 50,\r\n					y = prev + Math.random() * 10 - 5;\r\n\r\n				if (y < 0) {\r\n					y = 0;\r\n				} else if (y > 100) {\r\n					y = 100;\r\n				}\r\n\r\n				data.push(y);\r\n			}\r\n\r\n			// Zip the generated y values with the x values\r\n\r\n			var res = [];\r\n			for (var i = 0; i < data.length; ++i) {\r\n				res.push([i, data[i]])\r\n			}\r\n\r\n			return res;\r\n		}\r\n\r\n		// Set up the control widget\r\n\r\n		var updateInterval = 30;\r\n		$(\"#updateInterval\").val(updateInterval).change(function () {\r\n			var v = $(this).val();\r\n			if (v && !isNaN(+v)) {\r\n				updateInterval = +v;\r\n				if (updateInterval < 1) {\r\n					updateInterval = 1;\r\n				} else if (updateInterval > 2000) {\r\n					updateInterval = 2000;\r\n				}\r\n				$(this).val(\"\" + updateInterval);\r\n			}\r\n		});\r\n\r\n		var plot = $.plot(\"#placeholder\", [ getRandomData() ], {\r\n			series: {\r\n				shadowSize: 0	// Drawing is faster without shadows\r\n			},\r\n			yaxis: {\r\n				min: 0,\r\n				max: 100\r\n			},\r\n			xaxis: {\r\n				show: false\r\n			}\r\n		});\r\n\r\n		function update() {\r\n\r\n			plot.setData([getRandomData()]);\r\n\r\n			// Since the axes don\'t change, we don\'t need to call plot.setupGrid()\r\n\r\n			plot.draw();\r\n			setTimeout(update, updateInterval);\r\n		}\r\n\r\n		update();\r\n\r\n		// Add the Flot version string to the footer\r\n\r\n		$(\"#footer\").prepend(\"Flot \" + $.plot.version + \" &ndash; \");\r\n	});\r\n\r\n	</script></head><body><div id=header><h2>Real-time updates</h2></div><div id=content><div class=demo-container><div id=placeholder class=demo-placeholder></div></div><p>You can update a chart periodically to get a real-time effect by using a timer to insert the new data in the plot and redraw it.</p><p>Time between updates: <input id=updateInterval type=text value style=\"text-align: right; width:5em\"> milliseconds</p></div><div id=footer>Copyright &copy; 2007 - 2014 IOLA and Ole Laursen</div></body></html>");
$templateCache.put("src/client/bower_components/jquery-flot/examples/resize/index.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=Content-Type content=\"text/html; charset=utf-8\"><title>Flot Examples: Resizing</title><link href=../examples.css rel=stylesheet type=text/css><link href=../shared/jquery-ui/jquery-ui.min.css rel=stylesheet type=text/css><script language=javascript type=text/javascript src=../../jquery.js></script><script language=javascript type=text/javascript src=../shared/jquery-ui/jquery-ui.min.js></script><script language=javascript type=text/javascript src=../../jquery.flot.js></script><script language=javascript type=text/javascript src=../../jquery.flot.resize.js></script><script type=text/javascript>\r\n\r\n	$(function() {\r\n\r\n		var d1 = [];\r\n		for (var i = 0; i < 14; i += 0.5) {\r\n			d1.push([i, Math.sin(i)]);\r\n		}\r\n\r\n		var d2 = [[0, 3], [4, 8], [8, 5], [9, 13]];\r\n		var d3 = [[0, 12], [7, 12], null, [7, 2.5], [12, 2.5]];\r\n\r\n		var placeholder = $(\"#placeholder\");\r\n		var plot = $.plot(placeholder, [d1, d2, d3]);\r\n\r\n		// The plugin includes a jQuery plugin for adding resize events to any\r\n		// element.  Add a callback so we can display the placeholder size.\r\n\r\n		placeholder.resize(function () {\r\n			$(\".message\").text(\"Placeholder is now \"\r\n				+ $(this).width() + \"x\" + $(this).height()\r\n				+ \" pixels\");\r\n		});\r\n\r\n		$(\".demo-container\").resizable({\r\n			maxWidth: 900,\r\n			maxHeight: 500,\r\n			minWidth: 450,\r\n			minHeight: 250\r\n		});\r\n\r\n		// Add the Flot version string to the footer\r\n\r\n		$(\"#footer\").prepend(\"Flot \" + $.plot.version + \" &ndash; \");\r\n	});\r\n\r\n	</script></head><body><div id=header><h2>Resizing</h2></div><div id=content><div class=demo-container><div id=placeholder class=demo-placeholder></div></div><p class=message></p><p>Sometimes it makes more sense to just let the plot take up the available space. In that case, we need to redraw the plot each time the placeholder changes its size. If you include the resize plugin, this is handled automatically.</p><p>Drag the bottom and right sides of the plot to resize it.</p></div><div id=footer>Copyright &copy; 2007 - 2014 IOLA and Ole Laursen</div></body></html>");
